package components.formula.FractionFormula;

import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeListener;

import components.formula.formula.FormulaInterface;
import components.formula.horizontalLine.HorizontalLine;
import components.formula.horizontalLine.HorizontalLineInterface;
import components.formula.singleLineFormula.SingleLineFormula;
import components.listenersupport.PropertyListenerSupport;
import util.annotations.EditablePropertyNames;
import util.annotations.PropertyNames;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;

@StructurePattern(StructurePatternNames.BEAN_PATTERN)
@PropertyNames({"denominator", "enumerator", "fractionLine"})
@EditablePropertyNames({})
public class FractionFormula implements FractionFormulaInterface{
	
	private PropertyListenerSupport propertyListenerSupport = new PropertyListenerSupport();
	private FormulaInterface denominator, enumerator;
	private HorizontalLineInterface fractionLine;
	private int x, y, width, height;
	private double scale;
	public static final double FRACTION_SCALE = 0.5;
	public static final int MARGIN = 5, DEFAULT = 16, FRACTION_LINE_HEIGHT = 2;
	
	public FractionFormula(int newX, int newY, double newScale) {
		
		x = newX;
		y = newY;
		scale = newScale * FRACTION_SCALE;
		
		HorizontalLineInterface newFractionLine = new HorizontalLine(newX, newY, FRACTION_LINE_HEIGHT, DEFAULT);
		addPropertyChangeListener(newFractionLine);
		setFractionLine(newFractionLine);
		
		FormulaInterface newDenominator = new SingleLineFormula(newX, newY + FRACTION_LINE_HEIGHT + MARGIN + DEFAULT/2, getScale());
		newDenominator.addPropertyChangeListener(this);
		setDenominator(newDenominator);
		
		
		FormulaInterface newEnumerator = new SingleLineFormula(newX, newY - MARGIN - DEFAULT/2, getScale());
		newEnumerator.addPropertyChangeListener(this);
		setEnumerator(newEnumerator);
		
		
		
			
		
	}
	
	@Override
	public int getX() {
		return x;
	}
	
	@Override
	public void setX(int newX) {
		int diff = newX - x;
		x = newX;
		getDenominator().setX(getDenominator().getX() + diff);
		getEnumerator().setX(getEnumerator().getX() + diff);
		getFractionLine().setX(getFractionLine().getX() + diff);
	}
	
	@Override
	public int getY() {
		return y;
	}
	
	@Override
	public void setY(int newY) {
		int diff = newY - y;
		y = newY;
		getDenominator().setY(getDenominator().getY() + diff);
		getEnumerator().setY(getEnumerator().getY() + diff);
		getFractionLine().setY(getFractionLine().getY() + diff);
	}
	
	@Override
	public double getScale() {
		return scale;
	}
	
	@Override
	public void setScale(double newScale) {
		scale = newScale;
	}
	
	@Override
	public int getWidth() {
		return width;
	}
	
	@Override
	public int getHeight() {
		return height;
	}
	
	@Override
	public void setWidth(int newWidth) {
		int oldWidth = width;
		width = newWidth;
		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "width", oldWidth, width));
	}
	
	@Override
	public void setHeight(int newHeight) {
		int oldHeight = height;
		height = newHeight;
		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "height", oldHeight, height));
	}
	
	@Override
	public void addPropertyChangeListener(PropertyChangeListener aListener) {
		propertyListenerSupport.addElement(aListener);
	}
	
	@Override
	public void propertyChange(PropertyChangeEvent evt) {
		if ("height".equals(evt.getPropertyName()) | "width".equals(evt.getPropertyName()) | "string".equals(evt.getPropertyName())) {
			reposition();
		}
	}
	
	@Override
	public FormulaInterface getDenominator() {
		return denominator;
	}
	
	@Override
	public void setDenominator(FormulaInterface newDenominator) {
		denominator = newDenominator;
	}
	
	@Override
	public FormulaInterface getEnumerator() {
		return enumerator;
	}
	
	@Override
	public void setEnumerator(FormulaInterface newEnumerator) {
		enumerator = newEnumerator;
	}
	
	@Override
	public HorizontalLineInterface getFractionLine() {
		return fractionLine;
	}
	
	@Override
	public void setFractionLine(HorizontalLineInterface newFractionLine) {
		fractionLine = newFractionLine;
	}
	
	@Override
	public void reposition() {
		adaptHeight();
		adaptWidth();
		adaptFractionLine();
		adaptEnumerator();
		adaptDenominator();
	}
	
	public void adaptHeight() {
		setHeight(getEnumerator().getHeight() + getDenominator().getHeight() + getFractionLine().getHeight() + 2 * MARGIN);
	}
	
	public void adaptWidth() {
		setWidth(Math.max(getEnumerator().getWidth(), getDenominator().getWidth()));
	}
	
	
	public void adaptFractionLine() {
		if (getWidth() != 0) {
			getFractionLine().setWidth(getWidth());
		}
		else {
			getFractionLine().setWidth(DEFAULT);
		}
	}
	
	public void adaptEnumerator() {
		getEnumerator().setX(getX() + getWidth()/2 - getEnumerator().getWidth()/2);
		getEnumerator().setY(getY() - MARGIN - getEnumerator().getHeight()/2);
	}
	
	public void adaptDenominator() {
		getDenominator().setX(getX() + getWidth()/2 - getDenominator().getWidth()/2);
		getDenominator().setY(getY() + MARGIN + getDenominator().getHeight()/2);
	}

}

